import { dotPathNotEq } from '../';

var s = function s(x) {
  return JSON.stringify(x, null, 2);
};

describe('dotPathNotEq', function () {
  var itHelper = function itHelper(path, eq, x, result) {
    return it("for path ".concat(s(path), ", value to equal ").concat(s(eq), " object ").concat(s(x), " returns ").concat(result), function () {
      expect(dotPathNotEq(path)(eq)(x)).toEqual(result);
    });
  };

  itHelper('a.b', 3, {}, true);
  itHelper('a.b', 3, {
    a: {
      b: 1
    }
  }, true);
  itHelper('a.b', 3, {
    a: {
      b: 3
    }
  }, false);
});